import React from 'react';
import {  Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div>
      <li>
        <Link to="/register">Register</Link>
      </li>
      <li>
        <Link to="/login">Login</Link>
      </li>
    </div>
  );
}

export default Navbar;
